-- Обновляем временные метки
update users set updated_at = current_timestamp where created_at > updated_at; 
update finances set updated_at = current_timestamp where created_at > updated_at; 
update discounts set updated_at = current_timestamp where created_at > updated_at;
update discounts set finished_at = current_timestamp where started_at > finished_at;
update orders set updated_at = current_timestamp where created_at > updated_at; 
update orders_products set updated_at = current_timestamp where created_at > updated_at; 
update products set updated_at = current_timestamp where created_at > updated_at; 
update reviews set updated_at = current_timestamp where created_at > updated_at; 
update storehouses set updated_at = current_timestamp where created_at > updated_at; 
update storehouses_products set updated_at = current_timestamp where created_at > updated_at; 
update waiting_lists set updated_at = current_timestamp where created_at > updated_at; 

-- Рандомизируем id-ишники
select * from rubrics;

update rubrics set
	catalog_id = floor(1 + rand() * 25);

select * from discounts;

update discounts set
	user_id = floor(1 + rand() * 200),
	product_id = floor(1 + rand() * 300),
	discount = floor(1 + rand() * 80);

select * from finances;

update finances set
	user_id = floor(1 + rand() * 200),
	balance = floor(1 + rand() * 10000);

select * from orders;

update orders set
	user_id = floor(1 + rand() * 200);

select * from orders_products;

update orders_products set
	order_id = floor(1 + rand() * 200),
	product_id = floor(1 + rand() * 300),
	order_status_id = floor(1 + rand() * 4);

select * from products;

update products set
	rubric_id = floor(1 + rand() * 100),
	catalog_id = floor(1 + rand() * 25),
	brand_id = floor(1 + rand() * 100),
	size_id = floor(1 + rand() * 5),
	adress_id = floor(1 + rand() * 200);

select * from storehouses;

update storehouses set
	adress_id = floor(1 + rand() * 200);

select * from storehouses_products;

update storehouses_products set
	storehouse_id = floor(1 + rand() * 50),
	product_id = floor(1 + rand() * 300);

select * from waiting_lists;

update waiting_lists set
	product_id = floor(1 + rand() * 300),
	user_id = floor(1 + rand() * 200),
	waiting_status_id = floor(1 + rand() * 2);

alter table products add column price int;

update products set
	price = floor(100 + rand() * 30000);
select price from products;







